// src/components/UserNavbar.js
import React from 'react';

const UserNavbar = () => {
  return (
    <header className="bg-white dark:bg-gray-800 shadow px-6 py-4 flex justify-between items-center">
      <h1 className="text-xl font-semibold text-gray-800 dark:text-white">User Dashboard</h1>
      <div className="flex items-center gap-4">
        {/* Add avatar or dropdown later */}
        <span className="text-gray-600 dark:text-gray-300">Welcome, User</span>
      </div>
    </header>
  );
};

export default UserNavbar;
